import '../index.css'
export default function SortBar(properties) {
    return (
        <span className="sortbar">
            <div>Currently showing {properties.numShowing>50?properties.numShowing-50:0}-{properties.numShowing} of {properties.numTotal} items</div>
        </span>
    )
}
